import React from "react";
import {
  Card,
  CardActions,
  CardContent,
  CardMedia,
  Button,
  Typography,
} from "@material-ui/core";

export default function Course() {
  return (
    <div>
      <Card>
        <CardMedia style={{ height: 0, paddingTop: "56.25%" }}></CardMedia>
        <CardContent>
          <Typography>text</Typography>
          <Typography>text</Typography>
        </CardContent>
        <CardActions>
          <Button size={"small"} color={"primary"}>
            Go to article.
          </Button>
        </CardActions>
      </Card>
    </div>
  );
}
